import React, { useEffect, useState } from "react";

const MatchDetails = () => {
  const [matches, setMatches] = useState(null);
  const [athleteBlue, setAthleteBlue] = useState(null);

  useEffect(() => {
    const fetchMatches = async () => {
      const response =  fetch("/api/matches")
        .then(response => response.json())
        .then( data => {
          setMatches(data);
        });
    };

    fetchMatches();
  }, []);

  return (
    <div>
      {matches && matches.map((matches) => (
          <>
            <div key={matches.matchNo}>{matches.matchNo}</div>
            <AthleteDetails AthleteBlueIdProp={matches.athleteBlueId}/>
          </>
        ))}
    </div>
  );
};

const AthleteDetails = ({AthleteBlueIdProp}) => {
    const [athleteBlue, setAthleteBlue] = useState(null);
    useEffect(() => {
        const fetchAthleteBlue = async () => {
            const response = fetch(`/api/athletes/getbyid/${AthleteBlueIdProp.athleteBlueId}`)
            .then(response => {data = response.json()})
            .then(data => {
                console.log(data)
                setAthleteBlue(data)
            })
        }
        fetchAthleteBlue()
    })

    return (
        <>
            <div key={athleteBlue._id}>{athleteBlue._id}</div>
        </>
    )
}

export default {MatchDetails, AthleteDetails};
